import React from "react";

const Twitter = () => {
  const mystyle = {
    textAlign: "left",
  };
  return (
    <div style={mystyle}>
      <h2>Twitter</h2>
      <p>
        Follow us on Twitter for the latest updates, news, and announcements!
      </p>
    </div>
  );
};

export default Twitter;
